import styled from "styled-components";

export const AddUserDiv = styled.div`
  transition: all 0.1s;
  width: 80%;
  height: 70%;
  border-radius: 4px;
  background-color: white;
  margin-top: 5em;
  padding: 2em;
  box-sizing: border-box;
`;
